  return (
    <div className="product-card">
      <Link to={`/product/${product.id}`}>
        <img src={product.image} alt={product.title} />
        <h3>{product.title}</h3>
      </Link>

      <p>â‚¹{product.price}</p>

      <Link to={`/product/${product.id}`} className="view-btn">
        View Details
      </Link>
    </div>
  );
}

export default ProductCard;
